import React from 'react'

import { InputContainer } from './styles';

function Input({value, onChange}) {
  return (
    <InputContainer>
        <input value={value} onChange={onChange} placeholder="A busca é por usuário/repositório"/>
    </InputContainer>
  )
}

export default Input
